import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 24.2-634 Locking and securing after preparation.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-634.md","filePath":"vacode/24.2-634.md"}'),i={name:"vacode/24.2-634.md"},n=t('<h1 id="§-24-2-634-locking-and-securing-after-preparation" tabindex="-1">§ 24.2-634 Locking and securing after preparation. <a class="header-anchor" href="#§-24-2-634-locking-and-securing-after-preparation" aria-label="Permalink to &quot;§ 24.2-634 Locking and securing after preparation.&quot;">​</a></h1><p>When voting equipment has been properly prepared for an election, it shall be locked against voting and sealed, or if a voting or counting machine cannot be sealed with a numbered seal, it shall be locked with a key. The equipment keys and any electronic activation devices shall be retained in the custody of the general registrar and delivered to the officers of election as provided in § <a href="http://law.lis.virginia.gov/vacode/24.2-639/" target="_blank" rel="noreferrer">24.2-639</a>. After the voting equipment has been delivered to the polling places, the general registrar shall provide ample protection against tampering with or damage to the equipment.</p><p>Code 1950, § 24-301; 1970, c. 462, § 24.1-211; 1985, c. 458; 1993, c. 641; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0264" target="_blank" rel="noreferrer">264</a>; 2004, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0993" target="_blank" rel="noreferrer">993</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP1010" target="_blank" rel="noreferrer">1010</a>; 2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0540" target="_blank" rel="noreferrer">540</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0576" target="_blank" rel="noreferrer">576</a>; 2016, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0018" target="_blank" rel="noreferrer">18</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0492" target="_blank" rel="noreferrer">492</a>.</p>',3),o=[n];function l(c,g,p,s,d,h){return a(),r("div",null,o)}const v=e(i,[["render",l]]);export{_ as __pageData,v as default};
